#设置客户端连接服务器端的编码
set names utf8;
#丢弃数据库 如果存在
drop database if exists myzx;
#创建数据库
create database myzx charset=utf8;
#进入数据库
use myzx;

#创建用户表
CREATE TABLE user(
  uid int  primary key AUTO_INCREMENT,    # 用户id 主键 自增
  uname varchar(32),            #用户名
  upwd varchar(32),        #密码
  email varchar(64),         #邮箱
  phone varchar(16),         #手机号
  avater varchar(128) DEFAULT NULL,   # 头像图片路径
  genter char(1) NULL DEFAULT '1',   #性别  女 -0  男 --1
  birthday date         #出生年月
) ;
#用户表插入数据



#设计师数据表
CREATE TABLE desiger(
  desiger_id int  primary key AUTO_INCREMENT,  #id 自增 主键
  dname varchar(16),      #设计师姓名
  dpic varchar(255),      #设计师图像
  seraddres varchar(32),  #设计师服务情况
  city varchar(12),       #设计师城市
  fenge varchar(12),       #设计师风 格
  conten01 varchar(12),    #设计师内容
  conten02 varchar(12),    #设计师内容2
  consulting varchar(24),    #咨询
  communication varchar(24),   #沟通
  casepic01 varchar(255),     #案例图片
  casepic02 varchar(255),
  casepic03 varchar(255)
);


#案例详情表
DROP TABLE IF EXISTS `anli`;
CREATE TABLE anli(
  aid int primary key AUTO_INCREMENT,
   title varchar(255),
  tit_pic varchar(255),
  fangwutype varchar(64),
  renshu varchar(12),
  did int(11),
  foreign key(did) references desiger(desiger_id)
);


#设计师详情表
DROP TABLE IF EXISTS `deg_deiles`;
CREATE TABLE deg_deiles(
  des_id int primary key AUTO_INCREMENT,
  de_name varchar(24),
  de_grade varchar(20),
  de_avatar varchar(255),
  jingyan varchar(32),
  lilian varchar(255) ,
  de_fengge varchar(255),
  xiangqi varchar(1000)
);


#业主案例情况
DROP TABLE IF EXISTS `yzal`;
CREATE TABLE yzal(
  anli_id int primary key AUTO_INCREMENT,
  an_title varchar(255),
  an_pic varchar(255),
  jushi varchar(12),
  biaojian11 varchar(12),
  fenge varchar(12),
  rensu varchar(12),
  an_pic1 varchar(255),
  an_name varchar(12),
  getoffice varchar(255)
);

#插入数据

#业主案例详情表
DROP TABLE IF EXISTS `alxq`;
CREATE TABLE alxq(
  xqid int primary key AUTO_INCREMENT,
  xqpic varchar(255),
  xqfg varchar(12),
  xqfx varchar(12),
  xqtitle varchar(32),
  xqpic1 varchar(255),
  xqtext1 varchar(128),
  xqpic2 varchar(255),
  xqtext2 varchar(128),
  xqpic3 varchar(255),
  xqtext3 varchar(128),
  xqpic4 varchar(255),
  xqtext4 varchar(128),
  xqpic5 varchar(255),
  xqtext5 varchar(128),
  area varchar(16),
  loupan varchar(24),
  city varchar(12)
);


#商场数据表
DROP TABLE IF EXISTS `shopping`;
CREATE TABLE shopping(
  sid int primary key AUTO_INCREMENT,
  title varchar(128),
  pic varchar(255),
  dpiric varchar(12),
  squan varchar(12),
  piric varchar(12),
  store varchar(32)
);



#详情表
DROP TABLE IF EXISTS `mfsj`;
CREATE TABLE mfsj(
  mid int primary key AUTO_INCREMENT,
  house varchar(12),
  live varchar(12),
  choice varchar(24),
  style varchar(12),
  spaces varchar(24),
  preference varchar(12),
  other varchar(24),
  HouseStatu varchar(12),
  yhphone varchar(16)
  -- foreign key(yhphone) references user(phone)
);



/**收货地址信息**/
CREATE TABLE mszx_receiver_address(
  aid INT PRIMARY KEY AUTO_INCREMENT,
  user_id INT,                #用户编号
  receiver VARCHAR(16),       #接收人姓名
  province VARCHAR(16),       #省
  city VARCHAR(16),           #市
  county VARCHAR(16),         #县
  address VARCHAR(128),       #详细地址
  cellphone VARCHAR(16),      #手机
  fixedphone VARCHAR(16),     #固定电话
  postcode CHAR(6),           #邮编
  tag VARCHAR(16),            #标签名

  is_default BOOLEAN,          #是否为当前用户的默认收货地址
foreign key(user_id) references user(uid)

);


