/**购物车条目**/
CREATE TABLE mszx_shoppingcart_item(
  iid INT PRIMARY KEY AUTO_INCREMENT,
  user_id INT,      #用户编号
  product_id INT,   #商品编号
  count INT,        #购买数量
  is_checked BOOLEAN, #是否已勾选，确定购买
foreign key(user_id) references user(uid),
foreign key(product_id) references shopping(sid)
);


/**用户订单**/
CREATE TABLE mszx_order(
  oid INT PRIMARY KEY AUTO_INCREMENT,
  user_id INT,
  address_id INT,
  status INT,             #订单状态  1-等待付款  2-等待发货  3-运输中  4-已签收  5-已取消
  order_time BIGINT,      #下单时间
  pay_time BIGINT,        #付款时间
  deliver_time BIGINT,    #发货时间
  received_time BIGINT,    #签收时间
  foreign key(user_id) references user(uid),
  foreign key(address_id) references mszx_receiver_address(aid)

)AUTO_INCREMENT=10000000;


/**用户订单**/
CREATE TABLE mszx_order_detail(
  did INT PRIMARY KEY AUTO_INCREMENT,
  order_id INT,           #订单编号
  product_id INT,         #产品编号
  count INT,              #购买数量
  foreign key(order_id) references mszx_order(oid),
  foreign key(product_id) references shopping(sid)
   
);
