INSERT INTO `deg_deiles` VALUES (32, '谢美鱼','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzQ2YTUwYjRjOTEwNjI5MzUyM2VkZjI1MmVlYjZiMzFiXzIwMjItMDYtMzBUMjI6MTk6MTcuMTAz.jpg', '8年经验 | 169套案例', '设计理念：无之以为用', '现代简约\n                                日式\n                                极简风', '天津大学\n                    ·天作杯一等奖\n                    ·天津设计周一等奖\n                    ·爱好：长期健身\n                    ·唱歌，组过乐队和阿卡贝拉合唱团');
INSERT INTO `deg_deiles` VALUES (33, '任幸荣','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfL2VlN2JhNTU5NmRjYmY5ODhhNDM2NDlmMWI4NjU3ZWUwXzIwMjItMDYtMzBUMjI6MTk6MTcuNzk0.jpg', '8年经验 | 282套案例', '设计理念：设计源于生活，服务于生活', '法式风\n                                极简风\n                                INS风', '天津科技大学\n                    ·室内装饰设计师证/室内设计师资格证CIDA');
INSERT INTO `deg_deiles` VALUES (34, '李聪慧','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzM2MWM2MGE2YmNiYTg0N2E4ZGVlNjYxNzc0OTlhY2JlXzIwMjItMDYtMzBUMjI6MTk6MTguNDEz.jpg', '4年经验 | 150套案例', '设计理念：设计即平衡美学与实用学的过程', '轻奢风\n                                工业风\n                                北欧风', '天津大学\n                    ·天津市建筑装饰协会高级室内设计师\n                    ·中国室内装饰设计协会会员');
INSERT INTO `deg_deiles` VALUES (35, '梁浩冉','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzgwODA2MjQ3MTQ2ZTQwOTk5OGE0MGY2OWE0ZTUxNjYwXzIwMjItMDYtMzBUMjI6MTk6MTguODgw.jpg', '4年经验 | 30套案例', '设计理念：因生活而设计，因设计而完美', '法式风\n                                INS风\n                                轻奢风', '山东交通学院环境设计系\n                    ·中国室内装饰协会 认证设计师             \n                    ·筑巢设计大赛 创意优秀奖');
INSERT INTO `deg_deiles` VALUES (36, '杨秀凤','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfL2VhMzRhYzM3Y2E0ZmM2M2M2ZTYxZDgxMGJlODBiYWZlXzIwMjItMDYtMzBUMjI6MTk6MTkuNDI4.jpg', '5年经验 | 40套案例', '设计理念：以匠心服务于热爱生活的初心', '极简风\n                                工业风\n                                北欧风', '吉林建筑大学环境设计室内方向\n                    ·中国室内设计学会会员\n                    ·中国建筑装饰金鹰设计大赛空间设计奖');
INSERT INTO `deg_deiles` VALUES (37, '冼俊成','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzUyZjMzOWJkNzg4YWY4OTIwM2IwYmIxM2IzNGU4NWQyXzIwMjItMDYtMzBUMjI6MTk6MjAuMTQz.jpg', '4年经验 | 150套案例', '设计理念：比起满足空间设计的时尚华丽，我更愿意关注当下的实际意义，在建筑家的过程中做个解决问题的人。', '北欧风\n                                工业风\n                                现代简约', '华南师范大学\n                    ·获奖：三维家设计大赛优秀奖\n2018幸福家设计大赛最佳厨房奖\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：中国室内装饰协会会员\n擅长：大宅设计、全屋收纳、小家变大\n设计理念：比起满足空间设计的时尚华丽，我更愿意关注当下的实际意义，在建筑家的过程中做个解决问题的人。\n服务介绍：我比较倡导去风格标签化设计，致力于探索每位业主喜爱的生活方式，将家装与生活完美结合，使每个项目都有自己的风格，并与业主气质相契合。\n服务过的小区：富力悦禧、广啤雅苑、金迪城市花园金涛阁、侨怡苑、美的花湾城、荔富湖畔、淘金雅苑、翠城花园');
INSERT INTO `deg_deiles` VALUES (38, '何焯荣','高级设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzA4ZGE3MWUxY2IxZmJjNDBmMGI1ZmEwMmJkZmU0ZWMzXzIwMjItMDYtMzBUMjI6MTk6MjEuNDMx.jpg', '6年经验 | 200套案例', '设计理念：“少”，不是空白而是精简；“多”，不是拥挤而是完美。', '北欧风\n                                INS风\n                                美式', '本科\n                    ·获奖：2018多乐士大中华去空间色彩奖获奖者\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间销冠金牌设计师\n擅长：别墅设计、功能分区、视觉设计\n设计理念：“少”，不是空白而是精简；“多”，不是拥挤而是完美。\n服务介绍：作为颜狗的设计师们，会大费力气在展示个性或者追求风格的强烈导入上，把自己的喜好追求强加给业主，与之不同的是，我更愿意在阅读业主本身的背景文化跟生活习惯以后，以业主的诉求为出发点，结合专业来展现一个家的感觉。\n服务过的小区：雅居乐、翠园小区');
INSERT INTO `deg_deiles` VALUES (39, '吴彪','高级设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfL2RjNDRiZTdjZmU3NzA4MWNmZWU2YjA5ZDNlY2IxYzRlXzIwMjItMDYtMzBUMjI6MTk6MjEuODk1.jpg', '6年经验 | 200套案例', '设计理念：一个设计作品有三种反馈，可以，不行，和哇喔，最后一个哇喔是我们要去追寻的。', '法式风\n                                极简风\n                                复古风', '本科\n                    ·获奖：2018第十二届CIDA中国国际室内设计优秀奖\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间销冠金牌设计师\n擅长：旧房翻新、婚房设计、空间优化\n设计理念：一个设计作品有三种反馈，可以，不行，和哇喔，最后一个哇喔是我们要去追寻的。\n服务介绍：200+的设计经验，从业6年，解决了很多业主的高难度户型改造，同时在不断发掘自己的潜力和价值，我是吴彪，一个非常热爱生活的室内设计师，欢迎找我咨询设计、上门量房、硬装设计（整套完整施工图和3DVR效果图），我会将心比心，把每一笔费用都花在值得的地方，靠谱省心，找我就行。\n服务过的小区：星汇海珠湾');
INSERT INTO `deg_deiles` VALUES (40, '余文娉','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzYwYTRhOGY3ZGNhMDY5MjQ2OWZjNGQ0YzBkYmZiYjUxXzIwMjItMDYtMzBUMjI6MTk6MjIuNzI0.jpg', '4年经验 | 200套案例', '设计理念：人可以改变环境，环境可以影响人， 而设计则可以改变人和环境。', '轻奢风\n                                北欧风\n                                现代简约', '本科\n                    ·获奖：国际设计大赛（互艺奖）优秀奖\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间超级明星设计师\n擅长：住宅硬装设计、旧房翻新、全屋智能\n设计理念：人可以改变环境，环境可以影响人， 而设计则可以改变人和环境。\n服务介绍：一个话不多，专注用心洞悉设计的设计师，确定是你的话，我便会打开话匣，把我所学的好设计全用到您家。双向选择，为了你理想中的家，也为了我能真正帮到你。我是余文娉，设计过程是经过认真思忖的，不虚报，没有隐含，所以请放心联系我。\n服务过的小区：白云尚城');
INSERT INTO `deg_deiles` VALUES (41, '李玉婵','首席设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzRlN2RjOWM4MTQwNzczNmE1NzVhM2ViNTI1MmYzZTIzXzIwMjItMDYtMzBUMjI6MTk6MjQuMTU3.jpg', '6年经验 | 300套案例', '设计理念：家不只是一个内观的状态，它应该有适合一家人使用的布局，也有和周围环境及景观沟通的态度。', '轻奢风\n                                新中式\n                                工业风', '广东南华\n                    ·获奖：中国室内装饰协会“筑巢奖”\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间销冠金牌设计师\n擅长：色彩搭配、动线规划、亲子空间\n设计理念：家不只是一个内观的状态，它应该有适合一家人使用的布局，也有和周围环境及景观沟通的态度。\n服务介绍：一个从设计学徒入手披荆斩棘到销冠的设计师；一个小宇宙被点燃的空间设计师；主张“生活从细节做起”“家的感受比房子更重要”的美学鉴定师。我是李玉婵，创做高性价比有美感有爱的家居空间，最大程度上节省“业主爸爸妈妈”们的时间成本和精力成本。\n服务过的小区：跑马地花园、星汇海珠湾小区');
INSERT INTO `deg_deiles` VALUES (42, '李建辉','首席设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzMxNjFhNGJhMjlkYzgyYWU1Zjk3YTdjNjQzNzU1N2NjXzIwMjItMDYtMzBUMjI6MTk6MjQuNTk5.jpg', '7年经验 | 500套案例', '设计理念：以人为本，让设计与服务并进，在设计中和客户成为朋友，为客户创造一个温馨的家，追求生活合理和谐，设计与服务至上！', '极简风\n                                INS风\n                                复古风', '大专\n                    ·获奖：2019年PChouse Award私宅设计大奖城市榜广州TOP10\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间超级明星设计师\n擅长：户型扩容、翻新改造、小户型变大\n设计理念：以人为本，让设计与服务并进，在设计中和客户成为朋友，为客户创造一个温馨的家，追求生活合理和谐，设计与服务至上！\n服务介绍：非常关注设计作品的完美落地，注重与业主理念的一致性，通过设计帮助业主实现对居住空间的期许与愿景。我是李建辉，主做空间设计服务，注重口碑，保证实景落地可拍摄毕业照~\n服务过的小区：康大龙祥汇');
INSERT INTO `deg_deiles` VALUES (43, '曾宪格','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfL2UwY2Q0Mzc4ZmIyOGNiNGQyMzUwYTBlNzQ5ZDdmODJkXzIwMjItMDYtMzBUMjI6MTk6MjUuNjg0.jpg', '4年经验 | 200套案例', '设计理念：如果我有1000个设计想法，即使最终只有一个实现了，我也会非常满意。', '新中式\n                                日式\n                                法式风', '广东岭南职业技术学院\n                    ·获奖：2019 芒果奖中国住宅创意奖\n2020 设计本最佳居住空间奖\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间高级明星设计师\n擅长：硬装设计、软装设计、婚房设计\n设计理念：如果我有1000个设计想法，即使最终只有一个实现了，我也会非常满意。\n服务介绍：家，最重要的是快乐和舒适，我在对居住空间进行设计时，首要能力是对空间的合理改造，创新设计可以解决日常生活所需的储物需求，设定未来生活的场景。视觉氛围和效果，也是体现每个家庭独有的生活品味和生活态度。我是曾宪格，一个热爱全案设计的有趣灵魂，来门店找我聊聊吧~~\n服务过的小区：海珠南华西商厦、荔湾岭南湾畔小区、白云富力桃园、天河华景里、中海康城');
INSERT INTO `deg_deiles` VALUES (44, '林佳佳','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfL2E2MmY4YmRhMzU4YjViMGE5YzhlYTFhYTVmNjYzMGMyXzIwMjItMDYtMzBUMjI6MTk6MzQuMjQ2.jpg', '6年经验 | 200套案例', '设计理念：将设计融入生活，注重细节，注重实用，注重生活品质。', '轻奢风\n                                现代简约\n                                日式', '环境艺术专业毕业\n                    ·爱空间金牌设计师');
INSERT INTO `deg_deiles` VALUES (45, '刘思雨','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfL2E0YzRmOGFhYTVhOGE5NWQwZmUyYzRmOTkzNzE5ZDU3XzIwMjItMDYtMzBUMjI6MTk6MzYuMjc3.jpg', '4年经验 | 300套案例', '设计理念：持之以恒的学习是设计的来源，责任感是设计的原则，而灵感是设计的升华。', '现代简约\n                                新中式\n                                日式', '本科\n                    ·获奖：2018年中国设计年度精英设计师\n2019年广东省装饰行业优秀设计师\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间口碑冠军设计师\n擅长：全屋收纳、前沿搭配、小户型变大\n设计理念：持之以恒的学习是设计的来源，责任感是设计的原则，而灵感是设计的升华。\n服务介绍：从业5年，对家装设计有丰富的经验，我的价值在于，理解客户对家的精神需求，给予居住舒适功能外的艺术气氛，服务过的每一个家庭，都是展现我个人设计实力的最好纪念，为每一个家庭设计最具美观又实用的房子，让家的情感在房子里洋溢。\n服务过的小区：华江花园');
INSERT INTO `deg_deiles` VALUES (46, '林俊松','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzRiYjg5NzhjOGVmYTZlNGEzNzNjNDc4MjI2ODU5MzJjXzIwMjItMDYtMzBUMjI6MTk6MzcuMDg5.jpg', '4年经验 | 300套案例', '设计理念：家装设计代表了对于当下、过去和未来的一种综合态度：生存、生长和新生。', '工业风\n                                美式\n                                新中式', '辽宁传媒艺术设计系\n                    ·获奖：松狮设计大赛二等奖\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：中国室内装饰协会会员、爱空间口碑冠军设计师\n设计理念：家装设计代表了对于当下、过去和未来的一种综合态度：生存、生长和新生。\n服务介绍：从业数年，科班出身，见证了许多客户对新家的期待，从开始设计时的兴奋到入住后的舒心，这份满足不断督促我保持初心，热爱家装事业。我是林俊松，一位热衷于努力改善您居住品质，同时又有一点“设计洁癖”的高标准设计师。\n服务过的小区：中海康城');
INSERT INTO `deg_deiles` VALUES (47, '黄洁冰','主案设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzdmM2M1MmVmNTM0YjdhYjQxY2IyNzAzOWIwMzljNGRkXzIwMjItMDYtMzBUMjI6MTk6MzcuNzkx.jpg', '4年经验 | 200套案例', '设计理念：用心观察生活，感悟人生真谛，让设计与生活互动。', '轻奢风\n                                现代简约\n                                极简风', '广州东华职业学院装潢设计学院\n                    ·获奖：2019年中国红棉奖最美雅奢空间最佳先锋人物奖\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间销冠金牌设计师\n擅长：户型扩容、公寓改造、小户型变大\n设计理念：设计工作，不单单是精致的，而是好奇心和喜悦，源源不绝的思想、意识所孕育出来的。\n服务介绍：从业7年的职业设计师，主要从事家装设计，多年来以口碑为主，客户转介绍为主要客源，每一个项目都是为客户量身定做的设计作品，每一个作品都全力以赴做好落地服务，有自己的高标准、高效率、高度配合落地爱空间的产业工人。\n服务过的小区：云山诗意');
INSERT INTO `deg_deiles` VALUES (48, '蔡晓珊','高级设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzgwMDMzMWFhNzkxZjEwMjJiNWFkMWUwYzljNzAzNGMxXzIwMjItMDYtMzBUMjI6MTk6MzguNDIw.jpg', '7年经验 | 500套案例', '设计理念：设计工作，不单单是精致的，而是好奇心和喜悦，源源不绝的思想、意识所孕育出来的。', '工业风\n                                北欧风\n                                美式', '本科\n                    ·获奖：2019年PChouse Award私宅设计大奖城市榜广州TOP10\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间口碑冠军设计师\n擅长：户型扩容、公寓改造、小户型变大\n设计理念：设计工作，不单单是精致的，而是好奇心和喜悦，源源不绝的思想、意识所孕育出来的。\n服务介绍：从业7年的职业设计师，主要从事家装设计，多年来以口碑为主，客户转介绍为主要客源，每一个项目都是为客户量身定做的设计作品，每一个作品都全力以赴做好落地服务，有自己的高标准、高效率、高度配合落地爱空间的产业工人。\n服务过的小区：云山诗意');
INSERT INTO `deg_deiles` VALUES (49, '彭凯','高级设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfL2RkNjNjOTA5ODViMWY4OWE0YTJhYmFmNjUwMDExMmEzXzIwMjItMDYtMzBUMjI6MTk6NDAuODEw.jpg', '8年经验 | 500套案例', '设计理念：设计师必须同时扮演一名艺术家、一名医生及一名工程师。', '轻奢风\n                                现代简约\n                                极简风', '毕业于江西工业职业技术学院 深造于广州美术学院、包斯豪艺术学院\n                    ·获奖：ICDA国际建筑室内设计注册高级设计师 \n红棉中国优秀设计奖\n深造广州美术学院、包豪斯艺术学院\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：爱空间口碑冠军设计师\n擅长：硬装设计、软装设计、全屋设计\n设计理念：设计师必须同时扮演一名艺术家、一名医生及一名工程师。\n服务介绍：任职家装设计师9年，倡导去风格标签化设计，致力于探索每位业主喜爱的生活方式，将家装与生活完美结合，使每个项目都有自己的风格，并与业主的气质相契合。\n服务过的小区：保利西海岸、保利金沙湾、星河丹堤、帝景苑');
INSERT INTO `deg_deiles` VALUES (50, '吴锦珊','首席设计师', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/kylin/1921f4cf/f9347449/c3ffe071/457bed7d/ZGVzaWduZXJfLzc3ODI2NmMwMzdmN2YyMTNlODRlNTFkMjk2NjAzM2MwXzIwMjItMDYtMzBUMjI6MTk6NDIuMjc4.jpg', '6年经验 | 300套案例', '设计理念：放松、愉悦、治愈系的人居空间，让每一个家庭成员在徜徉着温暖质感的环境里，获得元气补充与慰籍。', '现代简约\n                                新中式\n                                复古风', '本科\n                    ·获奖：爱空间金牌销冠设计师\n客户评分：⭐️⭐️⭐️⭐️⭐️\n经历：广州ICS国际色彩大赛空间设计奖\n设计理念：放松、愉悦、治愈系的人居空间，让每个家庭成员在徜徉着温暖质感的环境里，获得元气补充与慰籍。\n服务介绍：300+设计及项目经验，擅长大宅设计、亲子空间、改善风水。希望能多与对设计有需求，对品质有要求的客户合作。设计就是通过一段时间的合作，去做好一件事情，并非单纯的甲方与乙方。\n服务过的小区：华南碧桂园、逸翠庄园、广州院子、海鸥岛、锦绣银湾、锦绣香江、蓝色康园、富力千禧、华港花园、盛世名门、信达金茂府、中海璟晖华庭、华景新城、天诚广场、华农茶山区、侨源山庄、星河湾、芳草园、星辰大厦');
