INSERT INTO `alxq` VALUES (1, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvdGx2Z20yXzIwMjItMDQtMDdUMTg6MDA6MDQuNDg0.jpg', '现代简约', '三居室', '骏景花园(骏景路)95平米三居室现代简约风装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvdGx2Z2gzXzIwMjItMDQtMDdUMTc6NTY6MjcuNTQw.jpg', '客餐厅的空间很大，虽然没有隔断，客厅和餐厅使用起来都是很方便的。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvdGx2Z2k0XzIwMjItMDQtMDdUMTc6NTY6MzMuMDM5.jpg', '白色和灰色的色调搭配很好，时尚的U型厨房合理的利用了空间，洗菜盆挨着窗户的设计避免了烹饪中潮湿的问题', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvdGx2Z2o1XzIwMjItMDQtMDdUMTc6NTY6MzguNDk5.jpg', '主卧采用白色和黄色调的搭配，白色衣柜和白色床单视觉效果很干净，淡灰色的窗帘令主卧增加了一丝神秘感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvdGx2Z2s2XzIwMjItMDQtMDdUMTc6NTY6NDQuMDAy.jpg', '为了增加有效的储物空间，次卧选择了一体式书柜的设计，学习和休息两不耽误。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvdGx2Z2w3XzIwMjItMDQtMDdUMTc6NTY6NDkuMzU5.jpg', '  卫生间内的卫浴设备简洁光滑，卫浴以及置物架都是光滑白色材质，窗户的设计解决了空间潮气的问题.', '112㎡', '骏景花园(骏景路)', '广州');
