INSERT INTO `alxq` VALUES (24, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbHQyXzIwMjItMDQtMDdUMTQ6MjY6MTkuNjEw.jpg', '现代简约', '三居室', '阳光棕榈园118平米三居室现代简约风装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDN0dXByOWsyXzIwMjItMDUtMzFUMTY6MTY6MDcuMTY0.jpg', '客厅用色不杂，在视觉上显得开阔，红木家具给人带来一种强烈的中式气息，视觉冲击力强。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDN0dXByOWwzXzIwMjItMDUtMzFUMTY6MTY6MTIuNjQ5.jpg', '餐厅的地面和墙面配色和谐统一，餐桌椅和收纳柜的颜色层次感强，建构出空间的品质感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDN0dXByOW00XzIwMjItMDUtMzFUMTY6MTY6MTcuMTg2.jpg', '厨房吊柜十分光洁，米灰色底柜铺设出新中式的风格基调，同时也增加了厨房储物的实用性。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDN0dXByOW41XzIwMjItMDUtMzFUMTY6MTY6MjIuMDEw.jpg', '主卧的色彩温馨明朗，以原木、灰、白相间，贴近自然，背景墙的设计使整个空间都丰富起来了。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDN0dXByOW82XzIwMjItMDUtMzFUMTY6MTY6MjYuNTQx.jpg', '次卧背景墙采用对称的手法设计，中部装饰画起到了点明主题的作用，远远看上去别有一番韵味。', '118㎡', '阳光棕榈园', '深圳');
INSERT INTO `alxq` VALUES (25, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbGYyXzIwMjItMDQtMDdUMTQ6MTg6MjYuMDU1.jpg', '现代简约', '二居室', '中海阳光玫瑰园100平米两居室现代简约风装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbG40XzIwMjItMDQtMDdUMTQ6MjA6NTcuODQy.jpg', '木质的柜子确保了鞋子摆放的位置，挂钩的设计更加人性化，满足业主进出替换衣物鞋子的需求。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbG8yXzIwMjItMDQtMDdUMTQ6MjE6MTIuNzYz.jpg', '简单的布艺沙发搭配独特的电视柜设计使得客厅更具艺术氛围。电视柜设计时尚，还满足了储物的功能。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbHAzXzIwMjItMDQtMDdUMTQ6MjE6NTEuMTAw.jpg', '餐桌放在了沙发旁边，确保居住者在用餐的同时也可以享受到客厅的娱乐需要。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbHE1XzIwMjItMDQtMDdUMTQ6MjI6MDYuNzgx.jpg', '厨房的上方采取了安装橱柜的设计，确保生活中多余的一些碗筷便可以找到合适的位置。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbHI2XzIwMjItMDQtMDdUMTQ6MjI6MjEuMDcx.jpg', '卧室仍旧选择了黄色的地板，强调空间一致性。大面积衣柜的设计，则满足女主人衣物收纳需求。', '100㎡', '中海阳光玫瑰园', '深圳');
INSERT INTO `alxq` VALUES (26, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbDEyXzIwMjItMDQtMDdUMTQ6MTI6NDkuODA2.jpg', '北欧风', '三居室', '城市绿洲花园115平米三居室欧式风格装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbDkyXzIwMjItMDQtMDdUMTQ6MTU6MDEuNDQ5.jpg', '客厅选择了白色的欧式沙发以及灰色的吊灯，整体的色彩度较高。正方茶几形奢华中透露着简单，高级感十足。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbGEzXzIwMjItMDQtMDdUMTQ6MTU6MDkuMTcy.jpg', '餐桌上方的吊灯则是时尚的水晶球构成，小资格调感十足，确保业主用餐中都能够拥有美好的心情。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbGI0XzIwMjItMDQtMDdUMTQ6MTU6MTQuODU0.jpg', '考虑到打扫方面的问题，厨房选择了比较深一些的橱柜，确保打理更加轻松，且与整体的欧式风格更加契合。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbGM1ICgyKV8yMDIyLTA0LTA3VDE0OjE1OjIwLjc3NQ==.jpg', '卧室的衣柜以及床铺仍旧保持了欧式的风格，墙面和床头的图案相映成章，为整个卧室带来一种舒适的居住体验。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRrbGQ2XzIwMjItMDQtMDdUMTQ6MTU6MjYuMDM3.jpg', '书房选择了大书柜的设计，为了满足书房看书的要求，书房内部设计小台灯，根本不需要担心照明的问题。', '115㎡', '城市绿洲花园', '深圳');
INSERT INTO `alxq` VALUES (27, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDRudGRidjExXzIwMjItMDYtMjFUMTY6MDk6MTcuNTk2.jpg', '现代简约', '三居室', '大冲城市花园110平米三居室现代简约风格装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRra3UyICgyKV8yMDIyLTA0LTA3VDEzOjAxOjM2LjMyOA==.jpg', '客厅借助细节的设计强调现代时尚氛围，不同灯饰的运用，则确保客厅能够营造出不同的氛围感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRra3YzXzIwMjItMDQtMDdUMTM6MDE6NDIuNTg3.jpg', '餐厅选择了白色的餐桌椅，和整体室内的风格方面相呼应，强调室内环境的一致和谐美', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRra3c0ICgyKV8yMDIyLTA0LTA3VDEzOjAxOjQ4Ljk0Ng==.jpg', '厨房选用黄色柜体，提升空间温馨氛围。合理的收纳设计，让厨房内部的空间得到了充分的利用。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRra3g1XzIwMjItMDQtMDdUMTM6MDE6NTUuNzM1.jpg', '卧室和办公融合成为了一体，为了增强卧室的灯光，卧室内设置了墙上灯，使得卧室具有不同的氛围感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvajRra3k2XzIwMjItMDQtMDdUMTM6MDI6MDEuODc2.jpg', '次卧摆放了一张单人床，次卧整体的风格强调清新，花色的窗帘以及独特的灯具为空间增添田园清新美。', '110㎡', '大冲城市花园', '深圳');
INSERT INTO `alxq` VALUES (28, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZDUyXzIwMjItMDQtMDdUMTI6NTA6MDAuODYw.jpg', '北欧风', '二居室', '光明一号94平米两居室简欧风装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZGMyXzIwMjItMDQtMDdUMTI6NTI6NDAuMDk0.jpg', '客厅长条的沙发和单把椅子满足了家人以及基本的会客需要，浅灰色的窗帘搭配实木家具，营造一种闲适悠闲氛围', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZGQzXzIwMjItMDQtMDdUMTI6NTM6MDYuMDQ0.jpg', '餐厅借助木质桌椅提升空间自然舒适氛围，墙面的黑色图片则让餐厅充满了艺术感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZGU0XzIwMjItMDQtMDdUMTI6NTM6MTIuMTYw.jpg', '时尚的U型厨房令烹饪多了一份乐趣，立式的吸油烟机的安装，确保了外观的整洁性以及吸油烟的理想效果。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZGY1XzIwMjItMDQtMDdUMTI6NTM6MTguNjMy.jpg', '卧室内部放置衣柜，满足日常收纳需求。田园系列的装饰点缀，这让空间更具自然温馨美。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZGc2XzIwMjItMDQtMDdUMTI6NTM6MjQuNzcz.jpg', '卫生间借助大量储物设计，提升空间利用率，避免出现杂乱感。', '94㎡', '光明一号', '深圳');
INSERT INTO `alxq` VALUES (29, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY3IyXzIwMjItMDQtMDdUMTI6MzY6MTQuNjA3.jpg', '新中式', '二居室', '香山美树苑95平米两居室中式风格装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY3oyXzIwMjItMDQtMDdUMTI6Mzk6MTUuOTky.jpg', '客厅的沙发选择很简单，长条的布艺沙发满足了多人乘坐的需要，圆形深色系的茶几使得客厅充满了不同的韵味。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZDAzXzIwMjItMDQtMDdUMTI6Mzk6MjMuNTg4.jpg', '餐桌上方的圆形灯具具有特色，白炽的灯光满足了用餐光线的需求。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZDE0XzIwMjItMDQtMDdUMTI6Mzk6MzEuODU0.jpg', '厨房上方的橱柜也解决了储物的问题。为了避免烹饪用脏墙面，灶台对应墙面的设计则为空间增添摩登氛围。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZDI1XzIwMjItMDQtMDdUMTI6Mzk6MzkuMzM0.jpg', '暗沉的色彩搭配凸显了中式的风格设计，卧室内部的小飘窗令时光变得更加悠闲。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsZDM2XzIwMjItMDQtMDdUMTI6Mzk6NDYuNTg0.jpg', '次卧大面积收纳柜设计即可以满足收纳需求，也可以成为空间装饰点缀，提升空间文艺气息。', '95㎡', '香山美树苑', '深圳');
INSERT INTO `alxq` VALUES (30, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY2QyXzIwMjItMDQtMDdUMTI6MTg6MjYuNDg2.jpg', '现代简约', '三居室', '文德福花园109平米三居室现代简约风格装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY2wyXzIwMjItMDQtMDdUMTI6MjA6MjUuNjIw.jpg', '客厅以浅灰色为主基调色，强调简约高级感。造型独特的吊灯搭配时尚的落地灯，有效提升了空间的艺术氛围。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY20zXzIwMjItMDQtMDdUMTI6MjA6MzIuMTAz.jpg', '餐厅和客厅借助软隔断进行区分，有效提升空间利用率。一套式桌椅衔接感强，有效提升了空间的功能感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY240XzIwMjItMDQtMDdUMTI6MjA6MzguMDkz.jpg', '厨房的上部以及下部空间得到了充分利用，为避免空间不足的尴尬问题，墙面安装了置物架，有效提升收纳面积。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY281XzIwMjItMDQtMDdUMTI6MjA6NDQuMDIz.jpg', '主卧选择了白色调的设计方式，强调温馨柔和氛围。灰色的窗帘则带来了一种更加宁静的感觉。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY3A2XzIwMjItMDQtMDdUMTI6MjA6NTAuODQ0.jpg', '次卧的墙面选择了条纹的设计，有效避免空间过于简约单调。几张简单的挂画，则为空间增添了现代时尚氛围。', '109㎡', '文德福花园', '深圳');
INSERT INTO `alxq` VALUES (31, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsYzMyXzIwMjItMDQtMDdUMTI6MTE6NTMuODE3.jpg', '现代简约', '一居室', '海天一色78平米一居室现代简约风格装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsYzkyXzIwMjItMDQtMDdUMTI6MTU6MDIuMzAx.jpg', '温暖的粉色墙面令人感觉到客厅很温馨，铺地毯的设计使得客厅可以乘坐的区域更大.', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY2EzXzIwMjItMDQtMDdUMTI6MTU6MDguMzkw.jpg', '为避免厨房的油烟跑道客厅，厨房方面采取安装了滑拉门的方式，有效提升厨房的私密性。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY2I0XzIwMjItMDQtMDdUMTI6MTU6MTQuNzM0.jpg', '卧室的墙面仍旧是粉色系，强调空间一致性，背景墙的挂画则让空间充满了艺术感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsY2M1XzIwMjItMDQtMDdUMTI6MTU6MjAuODQw.jpg', '具有独立窗户的卫生间有利于水分快速消散，配以透明玻璃门，满足干湿分离需求，提升生活质感。', '', NULL, '78㎡', '海天一色', '深圳');
INSERT INTO `alxq` VALUES (32, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvZndiNWIyXzIwMjItMDQtMDdUMTI6MDQ6MjIuOTU0.jpg', '北欧风', '三居室', '大冲城市花园139平米三居室简欧风装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsYngyXzIwMjItMDQtMDdUMTI6MDc6MzYuMTIw.jpg', '欧式的摆画、墙灯、吊灯以及窗帘选择，每一处都暗藏了房主对于欧式风格的喜爱。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsYnkzXzIwMjItMDQtMDdUMTI6MDc6NDUuMTc0.jpg', '设计师将一个独立空间打造成餐厅，餐桌以及吊灯则与简欧风格协调一致，处处都感觉到用心的设计。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsYno0XzIwMjItMDQtMDdUMTI6MDc6NTEuNTAz.jpg', 'U型的厨房设计能够让日常生活更加方便，独立的窗户设计，确保烹饪之后的油烟可以及时排出去。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsYzA1ICgyKV8yMDIyLTA0LTA3VDEyOjA3OjU3LjYxMA==.jpg', '卧室墙面的挂画以及床头柜的灯具，令人感觉到奢华的低调感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvaDlsYzE2XzIwMjItMDQtMDdUMTI6MDg6MDMuNDI3.jpg', '长书柜的设计方式，则满足多功能收纳需求，即便会家庭中的书不断增多也不需担心。', '139㎡', '大冲城市花园', '深圳');
INSERT INTO `alxq` VALUES (33, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvZndiNHUyXzIwMjItMDQtMDdUMTE6Mzg6MjguNTI4.jpg', '现代简约', '三居室', '中星海上名豪苑115平米三居室现代简约风装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvZndiNTMyXzIwMjItMDQtMDdUMTE6NTI6NDguNTcx.jpg', '灰色布艺沙发搭配黄色软装点缀，加之金属灯具加之，空间呈现精致感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvZndiNTQzXzIwMjItMDQtMDdUMTE6NTI6NTYuOTE3.jpg', '餐厅位于客厅一侧，简雅的餐桌椅让空间更具亲和力，用餐氛围素雅温馨。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvZndiNTU0XzIwMjItMDQtMDdUMTE6NTM6MDMuNzU0.jpg', '厨房空间经典布局，宽敞明亮，橱柜分色搭配，提升了空间的层次感。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvZndiNTc1XzIwMjItMDQtMDdUMTE6NTM6MTguODcy.jpg', '主卧背景墙设计层次分明，配以大地色床品装饰，彰显现代美学，空间更有品质。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvZndiNTg2XzIwMjItMDQtMDdUMTE6NTM6MjYuMDE5.jpg', '次卧动线流畅，空间中放置了小型沙发，细节处彰显出业主对品质生活的追求。', '115㎡', '中星海上名豪苑', '上海');
