INSERT INTO `alxq` VALUES (35, 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFubTY3cjEyXzIwMjItMDQtMDZUMjM6MDI6MTguOTcx.jpg', '现代简约', '三居室', '保利天鹅里苑123平米三居室现代简约风装修案例', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvY3oxNzMyXzIwMjItMDQtMDdUMTE6MjA6NDUuODM1.jpg', '客厅以白色作为基调，呈现出简约平静的视觉氛围，软装方面增加了些女性的柔情。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvY3oxNzQzXzIwMjItMDQtMDdUMTE6MjA6NTEuMTIy.jpg', '石膏线打破了背景的单一性，充盈着丰富的韵律和节奏，意味深远。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvY3oxNzU0XzIwMjItMDQtMDdUMTE6MjA6NTcuNjk4.jpg', '餐厅以米色贯穿主题，局部蓝色和黄色相间设计，进了整体空间的和谐统一。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvY3oxNzY1XzIwMjItMDQtMDdUMTE6MjE6MDUuODUw.jpg', '厨房空间采用米白色设计，满足烹饪功能的同时也营造出大气的氛围。', 'https://ikj-public.oss-cn-beijing.aliyuncs.com/market/d10af457/daa1deed/54e2c36b/5f295e7e/bDFvY3oxNzc2XzIwMjItMDQtMDdUMTE6MjE6MTEuOTY1.jpg', '主卧背景墙采用蓝色为背景，局部使用线条勾勒，拉升了空间的层次感。', '123㎡', '保利天鹅里苑', '上海');
